    [ExcludeFromCodeCoverage]
    public class RegistrationSubmissionsListViewModel
    {
        // To Do; Data should come from the page and passed to the component
        public RegistrationSubmissionsListViewModel()
        {
            PagedRegistrationSubmissionList = BuildTestData();
        }

        public List<RegistrationSubmissionDetails> PagedRegistrationSubmissionList { get; set; }

        private static List<RegistrationSubmissionDetails> BuildTestData()
        {
            List<RegistrationSubmissionDetails> objRet = new();

            foreach (string line in TestData.TSVData)
            {
                string[] fields = line.Split('\t');

                objRet.Add(new RegistrationSubmissionDetails
                {
                    OrganisationReference = fields[0].Substring(0,10),
                    OrganisationName = fields[1],
                    OrganisationType = Enum.Parse<RegistrationSubmissionOrganisationType>(fields[2]),
                    Status = Enum.Parse<RegistrationSubmissionStatus>(fields[3]),
                    ApplicationReferenceNumber = fields[4],
                    RegistrationReferenceNumber = fields[5],
                    RegistrationDateTime = DateTime.Parse(fields[8], new CultureInfo("en-GB")),
                    CompaniesHouseNumber = fields[9],
                    OrganisationId = Guid.Parse(fields[22]),
                    BusinessAddress = TestData.ParseAddress(line),
                    RegisteredNation = fields[23],
                    PowerBiLogin = "powerbi"
                });
            }

            return objRet;
        }
    }

    [ExcludeFromCodeCoverage]
